import { SOCIAL_NETWORK_PATH, SOCIAL_NETWORK_VER } from '../configs/vars';

const constantUrl = {
    SOCIAL_NETWORK_BASE: `${SOCIAL_NETWORK_PATH}/${SOCIAL_NETWORK_VER}`,
};

export default constantUrl;
